import React from 'react'
import ReactDOM from 'react-dom';



const Match = (Props) => {

    let {x,y,z} = Props;

    if ((x === y) && (y === z)) {
        return (
            <div>
                <h1>{x} {y} {z}</h1>
                <h2>This Is Matching</h2>
            </div>
        )
    }
    else{
        return (
            <div>
                <h1>{x} {y} {z}</h1>
                <h2>This Is Not Matching</h2>
            </div>
        )
    }

}


ReactDOM.render(
    <>
        <Match />
    </>,


    document.getElementById('root')
);
